BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "zoneh" (
	"victim"	varchar(90) NOT NULL,
	"description"	varchar(200) NOT NULL,
	"url"	varchar(90) NOT NULL,
	"created"	date NOT NULL,
	"org"	int NOT NULL
);
CREATE TABLE IF NOT EXISTS "leak" (
	"type"	varchar(30) NOT NULL,
	"expression"	varchar(100) NOT NULL,
	"details"	varchar(900) NOT NULL,
	"valid"	int NOT NULL,
	"url"	varchar(80) NOT NULL
);
CREATE TABLE IF NOT EXISTS "tts" (
	"id_user"	varchar(90) NOT NULL,
	"content"	varchar(200) NOT NULL,
	"id_post"	varchar(100) NOT NULL,
	"metadata"	varchar(1000) NOT NULL
);
CREATE TABLE IF NOT EXISTS "twitter_user" (
	"nick"	varchar(90) NOT NULL,
	"user_id"	varchar(100) NOT NULL,
	"user_active"	int(2)
);
CREATE TABLE IF NOT EXISTS "url" (
	"url"	varchar(300) NOT NULL,
	"status"	int(3) NOT NULL
);
CREATE TABLE IF NOT EXISTS "organization" (
	"id"	INTEGER NOT NULL,
	"alias"	VARCHAR NOT NULL,
	"information"	VARCHAR,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "login" (
	"id"	INTEGER NOT NULL,
	"username"	VARCHAR(32) NOT NULL,
	"email"	VARCHAR(64) NOT NULL,
	"password"	VARCHAR NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "h_telegram" (
	"id"	INT NOT NULL,
	"t_id"	VARCHAR(40) NOT NULL
);
CREATE TABLE IF NOT EXISTS "clients" (
	"id"	INTEGER NOT NULL,
	"name"	VARCHAR NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "session" (
	"id"	INTEGER NOT NULL,
	"value"	VARCHAR NOT NULL,
	FOREIGN KEY("id") REFERENCES "login"("id"),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "alert" (
	"t_id"	VARCHAR(40) NOT NULL,
	"text"	VARCHAR NOT NULL,
	"data"	DATE NOT NULL,
	"status"	int(2) NOT NULL,
	FOREIGN KEY("t_id") REFERENCES "h_telegram"("t_id")
);
CREATE TABLE IF NOT EXISTS "vector" (
	"id"	INTEGER NOT NULL,
	"data"	VARCHAR NOT NULL,
	FOREIGN KEY("id") REFERENCES "login"("id"),
	PRIMARY KEY("id")
);
